import React from "react";
import img3 from '../assets/img3.jpg';
import img4 from '../assets/img4.png';
import logo2 from '../assets/logo2.png'
import logo3 from '../assets/logo3.png'


export default function Page2() {
    return (
        <div>
            <table className="pagetabl"
                style={{ width: '100vw', height: '100vh', overflow: "hidden", background: ' #FFF4E3' }}>
                <tr style={{ height: '50vh' }}>
                    <td><img src={img3} style={{ width: '50vw' }} /></td>
                    <td className="" style={{ padding: '9%' }}>
                        <span><img style={{width:'20%', height:'10%'}} src={logo2}/></span>
                        <span className="text2 "><h3 className="mb-0">Feel cozy and comfortable</h3></span>
                        <span style={{fontSize:'130%'}}>{'Classy and stylish, this kaftan is made of cotton, which keeps you cozy and comfortable. It is gentle on your skin and gives you comfort with high breathability.'}
                        </span>
                    </td>
                </tr>
                <tr>
                    <td></td>
                    <td><img src={img4} style={{ width: '50vw', height: '50vh' }} /></td>
                </tr>
            </table >
        </div>
    );
}
